  render() {
    return (
      <div>
        <p></p>
        <h2>Solution For Blind People</h2>
        <p>
        The project goal is to create
        <strong> electronic eyes </strong>
         for <strong></strong> blind  <strong></strong> people  <strong></strong> which will be provided free of charge to them. Electronic eyes  will be an electronic appliance which can function on the basis of the artificial intelligence. Since blind people cannot see, the artificial intelligence can see instead of them and voice the surrounding objects.
<br></br><br></br>
2.2 billion people have a vision impairment or blindness
<br></br>
The majority of people with vision impairment are over the age of 50 years.
<br></br>
Blindness is a very serious problem. It is the inability to see anything even light.
        </p>
        <p>
          <a className="linkSolution" href="https://www.patreon.com/electroniceyes">Support on patreon</a>
        </p>
      </div>
    //<div>{this.state.content}</div>
    );
  }
}

export default Solution;
